import React from "react";
import '../Navbar/navbar.css'
function Navbar() {
    return (
        <nav>
            <div class="logo">Logo</div>
            <div class="nav-menu">
                <a href="/">Home</a>
                <a href="/Note">Note</a>
                <a href="/About">About</a>
                <a href="/Contact">Content</a>
            </div>
        </nav>
    )

}

export default Navbar;
